//Fill Radio List and display selected station
//Display Image data format
var TIME = 'data:image/webp;base64,';

//Display Radio Stations List

function RadioViewModel() {var _this = this;
  this.stations = [
  { name: 'Radio City', frequency: '91,1', cover: TIME },
  { name: 'Big FM', frequency: '92,7', cover: TIME },
  { name: 'Red FM', frequency: '93,5', cover: TIME },
  { name: 'Radio One FM', frequency: '94,3', cover: TIME },
  { name: 'Radio Mirchi FM', frequency: '98,3', cover: TIME }];

  this.activeStationId = ko.observable(null);
  this.activeStation = ko.computed(function () {
    if (_this.activeStationId() !== null) {
      return _this.stations[_this.activeStationId()];
    } else {
      return null;
    }
  });

  this.activateStation = function (index) {return (
      _this.activeStationId(_this.activeStationId() !== index ? index : null));};
}

ko.bindingHandlers.fade = {
  init: function init(element) {return $(element).hide();},
  update: function update(element, valueAccessor) {
    var $element = $(element);
    var value = ko.unwrap(valueAccessor());
    var $name = $element.find('#name');
    $element.fadeOut(function () {
      if (value) {
        $name.text(value.name);
        $element.fadeIn();
      } else {
        $name.text('');
      }
    });
  } };

//Slide up and down
ko.bindingHandlers.slide = {
  init: function init(element) {return $(element).hide();},
  update: function update(element, valueAccessor) {
    var value = ko.unwrap(valueAccessor());
    value ? $(element).slideDown() : $(element).slideUp();
  } };


ko.applyBindings(new RadioViewModel());

$('#surendra > section').perfectScrollbar();